import {createRoot} from 'react-dom/client';
import React from 'react';
import './index.css';
import App from './App';

const rootElement = 
document.getElementById('root');
const root = 
createRoot(rootElement);

root.render(
  <StrictMode>
    <App />
  </StrictMode>,
);
